import { Component, Input, OnInit } from '@angular/core';
import { TransaccionMoneda } from 'src/app/interfaces/transaccionMoneda';
import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
import { BusinessService } from 'src/app/core/services/business.service';
import { DatePipe } from '@angular/common';
pdfMake.vfs = pdfFonts.pdfMake.vfs;
@Component({
  selector: 'app-pdf-reporte-transaccion',
  templateUrl: './pdf-reporte-transaccion.component.html',
  styles: [],
})
export class PdfReporteTransaccionComponent implements OnInit {
  @Input()
  transacciones: TransaccionMoneda[] = [];
  @Input()
  from: string;
  @Input()
  to: string;

  business = this.businessService.businessInformation;
  constructor(
    private businessService: BusinessService,
    private datePipe: DatePipe
  ) {}

  ngOnInit(): void {}

  subscribeBusiness() {
    this.businessService.business.subscribe(
      (business) => {
        if (business) {
          this.business = business;
        }
      }
    );
  }

  exportToPdf() {
    let dolaresDisponibles = 0;
    const bodyDolar: any = [
      [
        { text: 'Fecha', alignment: 'center', style: 'tableHeader' },
        { text: 'Operacion', style: 'tableHeader' },
        { text: 'Cantidad en dolares', style: 'tableHeader' },
        { text: 'Precio dolar', style: 'tableHeader' },
        { text: 'Cantidad total', style: 'tableHeader' },
        { text: 'Precio dolar oficial', style: 'tableHeader' },
        { text: 'Cantidad real', style: 'tableHeader' },
        { text: 'Diferencia', style: 'tableHeader' },
      ]
    ];
    for (const transaccion of this.transacciones) {
      if (transaccion.operacion === 'VENTA') {
        dolaresDisponibles -= +transaccion.cantidad;
      }else {
        dolaresDisponibles += +transaccion.cantidad;
      }
      bodyDolar.push(
        [
          `${this.datePipe.transform(transaccion.createdAt, 'shortDate')}`,
          `${transaccion.operacion}`,
          `$. ${transaccion.cantidad}`,
          `Bol. ${transaccion.tipoCambio}`,
          `Bol. ${(transaccion.tipoCambio * transaccion.cantidad).toFixed(1)}`,
          `Bol. ${transaccion.tipoCambioOficial}`,
          { text: `Bol. ${(transaccion.cantidad * transaccion.tipoCambioOficial).toFixed(1)}`, alignment: 'center' },
          { text: `Bol. ${transaccion.diferencia}`, alignment: 'center' },
        ]
      );
    }
    const reporte = {
      pageSize: 'LETTER',
      pageOrientation: 'landscape',
      pageMargins: [20, 15, 15, 20],
      content: [
        //FECHA Y HORA ACTUAL AL IMPRIMIR
        {
          text: `${this.datePipe.transform(Date.now(), 'medium')}`,
          fontSize: 8,
        },
        {
          columns: [
            {
              width: 90,
              height: 40,
              fontSize: 9,
              margin: [22, 10, 0, 0],
              image:
                'data:image/png;base64,',
            },

            [
              // REPORTE DE PRESTAMOS
              {
                text: `Reporte de 'COMPRA VENTA DE DOLARES'`,

                color: '#333333',
                width: 800,
                fontSize: 20,
                bold: true,
                alignment: 'center',
                margin: [0, 0, 0, 0],
              },
            ],
          ],
        },
        '\n',
        {
          columns: [
            {
              width: 250,
              text: `Cambio Oficial del Dolar ${this.business.cambioDolar}`,
              bold: true,
              fontSize: 14,
            },
            { width: '*', text: '' },
          ],
        },

        {
          style: 'tableExample',
          table: {
            widths: [60, 60, 150, 100, 60, 42, 40, 50],
            headerRows: 1,
            body: bodyDolar,
          },
          layout: 'lightHorizontalLines',
        },
        {
          style: 'tableExample',
          table: {
            widths: [300, 100, 10],
            headerRows: 1,
            body: [
              [
                {
                  text: 'Total de Dolares disponibles',
                  fontSize: 16,
                  style: 'tableHeader',
                },
                { text: `$. ${dolaresDisponibles.toFixed(1)}`, alignment: 'right', fontSize: 16 },
                { text: '', alignment: 'left', fontSize: 16 },
              ],
            ],
          },
          layout: 'noBorders',
        },
      ],
      styles: {
        tableHeader: {
          bold: true,
          fontSize: 10,
          color: 'black',
        },
        tableExample: {
          margin: [0, 10, 0, 5],
        },
      },
    };
    pdfMake.createPdf(reporte).open();
  }
}
